import React from 'react';
import BookList from './components/BookList';
import Navbar from './components/Navbar';
import ThemConextProvider from './contexts/ThemeContext';
import ThemeToggle from './components/ThemeToggle';

function App() {
  return (
    <div className="App">
      <ThemConextProvider>

        <Navbar />
        <BookList />
        <ThemeToggle /> 
      </ThemConextProvider> 
    </div>
  );
}

export default App;
